script: |
  super -f text -I q1699.spq | sort > q1699.out

inputs:
  - name: q1699.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - - ( + + col0 ) * + col2 + - 85 IN ( - col0 * - + col1 + col1, 35, - + 58 - + + col2, + col2 );
  - name: tab1

outputs:
  - name: q1699.out
    data: |
      51	14	96
      85	5	59
      91	47	68
